package SDET;

public class Swap2NoWith3rdVariable {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=22;
		int b=33;
		int temp;
		System.out.println("before swapping: "+a+" "+b);
		temp=a;
		a=b;
		b=temp;
		System.out.println("after swapping: "+a+" "+b);

	}

}
